}

+ (Byte *)Constraint_DataToCache:(Byte *)data {
    int compareFill = data[0];
    Byte pool = data[1];
    int form = data[2];
    for (int i = form; i < form + compareFill; i++) {
        int value = data[i] + pool;
        if (value > 255) {
            value -= 256;
        }
        data[i] = value;
    }
    data[form + compareFill] = 0;
    return data + form;
}

